Описание:
Продам земельный участок ,площадью 6 ГА . ( бывшая нефтебаза, на данный момент не действующая) , из которых 2,8 Га и 1,5Га в аренде до 2052 года , остальное в собственности ( 1 км ж/д ветка и 0.8 км дорога) . 
Нефтебаза расположена на границе г. Воронежа и Новоусманского района Воронежской области . . Нефтебаза расположена на расстоянии 900 м от автомагистрали Дон-1 и имеет удобный выезд на нее в направлениях на Москву, Ростов-на-Дону, Курск. Рядом с нефтебазой пролегает магистральный нефтепродуктопровод, к которому возможно подключение. Нефтебаза имеет собственный железнодорожный подъездной путь общей длиной 1 002 м при ст. Придача Ю-ВОСТ ж.д., состоящий из ходового пути (полезная длина 420 м) и двух погрузо-выгрузочных путей (полезная длина 88 м) 
В состав имущества нефтебазы, принадлежащего на праве собственности, входят:
- административно-бытовой корпус;
- склад площадью 1 020 кв. м;
- насосная станция;
- автодорога длиной 160 м;
- железнодорожный подъездной путь необщего пользован ..., 12 фото
